import React from 'react';

const Work4 = () => {
    return (
        <div id='work4' className='tc dib br3 pa3 ma2 bw2 shadow-5'>
            <p>January '14 - November '15 || ~ 2 years</p>
            <hr></hr>
            <h6>Practical Lesson Demonstrator</h6>
            <p>I prepared and facilitated Physiology practical classes for undergraduate students during my postgraduate studies.</p>
            <hr></hr>
            <p>Stellenbosch University</p>
        </div>
    );
}

export default Work4;
